    false,nt"url": null,nt"notes": "Watershed Sciences, Inc. collected Light
    Detection and Ranging (LiDAR) data for the Sandy River study area in collaboration
    with the USDA Forest Service. The areas for LiDAR collection have been designed
    as part of a collaborative effort of state, federal, and local agencies in order
    to meet a wide range of project goals. This LiDAR data set was collected Sept 29
    - Oct 1, 2008 and falls mainly in Multnomah County, but also in small portions of
    Clark and Clackamas Counties, Oregon. This data set consists of bare earth and unclassified
    points. The average pulse density is 8.04 pulses per square meter over terrestrial
    surfaces. The area of interest (AOI) encompasses approximately 34,021 acres and
    the total area flown (TAF) covers 35,873 acres. The TAF acreage is greater than
    the original AOI acreage due to buffering and flight planning optimization. In some
    areas of heavy vegetation or forest cover, there may be relatively few ground points
    in the LiDAR data. Elevation values for open water surfaces are not valid elevation
    values because few lidar points are returned from water surfaces. Lidar intensity
    values were also collected.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
